package dataTypeDemo;

public class FloatDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		float my_percentage = (float) 62.93;
		float my_inter_per = 76.49f;
		double my_10th_per = 74.78;
		System.out.println(my_percentage);
		System.out.println(my_inter_per);
		System.out.println(my_10th_per);
	}

}
